import React, { Component } from "react";
import MainHeader from "./MainHeader";
import Dashboard from "./Dashboard";

export class MainPage extends Component {
  constructor(props) {
    super(props);

    this.state = {
      isLogedIn: false,
      userLogedIn: "",
    };
  }
  myCallback = (LogedIn) => {
    this.setState({ isLogedIn: LogedIn });
  };

  render() {
    return (
      <div>
        <div>
          <MainHeader></MainHeader>
        </div>
        <div>
          <Dashboard callbackFromParent={this.myCallback}></Dashboard>
        </div>
      </div>
    );
  }
}

export default MainPage;
